// src/components/Location.js
import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { QRCodeSVG } from 'qrcode.react';

const Location = () => {
  const [showQR, setShowQR] = useState(false);
  const venueAddress = "The Grand Palace Hotel, Marine Drive, Mumbai, Maharashtra 400020";
  const googleMapsUrl = `https://maps.google.com/?q=${encodeURIComponent(venueAddress)}`;

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.6,
        ease: "easeOut"
      }
    }
  };

  return (
    <section className="section-padding bg-gradient-to-br from-burgundy to-dark-burgundy">
      <motion.div
        variants={containerVariants}
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true, margin: "-100px" }}
        className="w-full max-w-6xl mx-auto"
      >
        <motion.div variants={itemVariants} className="text-center mb-12">
          <h2 className="luxury-heading text-gold mb-6">Venue Location</h2>
          <div className="w-24 h-1 bg-gradient-to-r from-gold to-light-gold mx-auto rounded-full"></div>
        </motion.div>

        <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 items-center">
          <motion.div variants={itemVariants} className="modern-card bg-white/10 backdrop-blur-sm text-white">
            <h3 className="luxury-subheading text-gold text-center mb-6">
              The Grand Palace Hotel
            </h3>

            <div className="space-y-4 mb-8">
              <div className="flex items-center gap-4">
                <div className="w-12 h-12 bg-gold/20 rounded-full flex items-center justify-center flex-shrink-0">
                  <span className="text-xl">üìç</span>
                </div>
                <p className="luxury-text text-white/90">
                  Marine Drive, Mumbai<br />
                  Maharashtra 400020, India
                </p>
              </div>

              <div className="flex items-center gap-4">
                <div className="w-12 h-12 bg-gold/20 rounded-full flex items-center justify-center flex-shrink-0">
                  <span className="text-xl">üöó</span>
                </div>
                <p className="luxury-text text-white/90">
                  Ample parking available<br />
                  Valet service provided
                </p>
              </div>
            </div>

            <div className="flex flex-col sm:flex-row gap-4 justify-center">
              <motion.button
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
                className="luxury-btn flex-1 text-center"
                onClick={() => window.open(googleMapsUrl, '_blank')}
              >
                Get Directions
              </motion.button>

              <motion.button
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
                className="luxury-btn flex-1 text-center"
                onClick={() => setShowQR(!showQR)}
              >
                {showQR ? 'Hide QR' : 'Show QR'}
              </motion.button>
            </div>
          </motion.div>

          <motion.div variants={itemVariants} className="relative">
            {/* Map placeholder - you can replace with actual map component */}
            <div className="modern-card bg-white/10 backdrop-blur-sm h-64 sm:h-80 rounded-2xl flex items-center justify-center">
              <div className="text-center text-white/80">
                <span className="text-4xl mb-4 block">üó∫Ô∏è</span>
                <p className="luxury-text">Interactive Map</p>
                <p className="luxury-text text-sm">(Would show actual map in production)</p>
              </div>
            </div>
          </motion.div>
        </div>

        <AnimatePresence>
          {showQR && (
            <motion.div
              initial={{ opacity: 0, scale: 0.8 }}
              animate={{ opacity: 1, scale: 1 }}
              exit={{ opacity: 0, scale: 0.8 }}
              className="flex justify-center mt-8"
            >
              <div className="modern-card bg-white p-6 text-center max-w-xs">
                <h4 className="luxury-subheading mb-4">Scan for Directions</h4>
                <div className="p-4 bg-white rounded-xl border-2 border-gold">
                  <QRCodeSVG 
                    value={googleMapsUrl} 
                    size={150}
                    level="H"
                    includeMargin
                  />
                </div>
                <p className="luxury-text text-sm mt-4">
                  Scan this QR code to open location in Google Maps
                </p>
              </div>
            </motion.div>
          )}
        </AnimatePresence>
      </motion.div>
    </section>
  );
};

export default Location;
